import React,{Component} from 'react';
import './Listrow.css'

class Listrow extends Component{
    constructor(){
        super()
    }
    render(){
        return(
            <div className='listitem'>
              <input type="checkbox" checked={this.props.checked}/>
              {this.props.content}
            </div>
        )
    }
}
export default Listrow
